import React, { useRef } from "react";
import "./Work.css";

const cards = [
  {
    title: "AcheAlguem",
    description: "Register and locate missing persons",
    tags: ["NextJS", "Typescript", "2025"],
    img: "https://images.unsplash.com/photo-1748392242228-fe7ebd0b8a86?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
    link: "https://achealguem.com.br/"
  },
  {
    title: "Project Two",
    description: "Description for project two",
    tags: ["React", "JavaScript", "2024"],
    img: "https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=800&q=80",
    link: "#"
  },
  {
    title: "Project Three",
    description: "Description for project three",
    tags: ["Vue", "TypeScript", "2023"],
    img: "https://images.unsplash.com/photo-1498050108023-c5249f4df085?auto=format&fit=crop&w=800&q=80",
    link: "#"
  },
  {
    title: "Project Four",
    description: "Description for project four",
    tags: ["Angular", "SCSS", "2025"],
    img: "https://images.unsplash.com/photo-1517694712202-14dd9538aa97?auto=format&fit=crop&w=800&q=80",
    link: "#"
  },
  {
    title: "Project Five",
    description: "Description for project five",
    tags: ["NextJS", "Tailwind", "2024"],
    img: "https://images.unsplash.com/photo-1519125323398-675f0ddb6308?auto=format&fit=crop&w=800&q=80",
    link: "#"
  },
];

function Work() {
  const containerRef = useRef(null);

  const scroll = (direction) => {
    if (containerRef.current) {
      const scrollAmount = containerRef.current.clientWidth / 2;
      containerRef.current.scrollBy({
        left: direction === "left" ? -scrollAmount : scrollAmount,
        behavior: "smooth",
      });
    }
  };

  return (
    <div className="work-container">
      <h2>My Work</h2>
      <div className="carousel-wrapper">
        <button
          className="scroll-btn left"
          aria-label="Scroll left"
          onClick={() => scroll("left")}
        >
          &#8592;
        </button>
        <div
          className="ache-cards-row"
          role="group"
          aria-roledescription="slide"
          ref={containerRef}
        >
          {cards.map(({ title, description, tags, img, link }, i) => (
            <a
              href={link}
              target="_blank"
              rel="noopener noreferrer"
              className="ache-card-link"
              tabIndex={0}
              key={i}
            >
              <div className="ache-card">
                <div className="ache-image-wrapper">
                  <img alt={title} loading="lazy" decoding="async" src={img} className="ache-image" />
                </div>
                <div className="ache-content">
                  <div>
                    <h3 className="ache-title">{title}</h3>
                    <p className="ache-description">{description}</p>
                    <div className="ache-tags">
                      {tags.map((tag, idx) => (
                        <span key={idx} className="ache-tag">{tag}</span>
                      ))}
                    </div>
                  </div>
                  <div className="ache-icon">
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="24"
                      height="24"
                      viewBox="0 0 24 24"
                      fill="none"
                      stroke="currentColor"
                      strokeWidth="2"
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      className="arrow-icon"
                      aria-hidden="true"
                    >
                      <path d="M7 7h10v10"></path>
                      <path d="M7 17 17 7"></path>
                    </svg>
                  </div>
                </div>
              </div>
            </a>
          ))}
        </div>
        <button
          className="scroll-btn right"
          aria-label="Scroll right"
          onClick={() => scroll("right")}
        >
          &#8594;
        </button>
      </div>
    </div>
  );
}

export default Work;
